import './App.css';
// This is a React Router v6 app
import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";
import Home from './components/Home';
import Login from './components/Login';
import User from './components/User';

function App() {


  return (
    <div>

      <BrowserRouter>
        <Routes>
          <Route path="/" element={
            <Home/>
          }/>
          <Route path="/user" element={
            <User/>
          }/>
          <Route path="/login" element={
            <Login/>
          }/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
